import * as React from 'react';
import Box from '@mui/material/Box';
import Avatar from '@mui/material/Avatar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Tooltip from '@mui/material/Tooltip';
import AccountBoxIcon from '@mui/icons-material/AccountBox';
import ShoppingCartCheckoutIcon from '@mui/icons-material/ShoppingCartCheckout';
import LogoutIcon from '@mui/icons-material/Logout';

export default function UserDashBoard() {

  return (
    <React.Fragment>
      <Box sx={{ display: 'flex', alignItems: 'center', textAlign: 'center' }}>
        <Typography sx={{ minWidth: 200 }}>Contact</Typography>
        <IconButton href="/profile" size="small" edge="start" color="inherit" aria-label="menu" sx={{ mr: 1 }}>
          < AccountBoxIcon/>
        </IconButton>

        <IconButton href="/cart" size="small" edge="start" color="inherit" aria-label="menu" sx={{ mr: 1 }}>
          < ShoppingCartCheckoutIcon/>
        </IconButton>

        <Typography sx={{ minWidth: 200 }}>Order History</Typography>
        <Typography sx={{ minWidth: 200 }}>Favourites</Typography>
        <Tooltip title="Account settings">
          <IconButton
            size="small"
            sx={{ ml: 2 }}
            aria-haspopup="true"
          >
            <Avatar sx={{ width: 32, height: 32 }}>M</Avatar>
          </IconButton>
        </Tooltip>

        <IconButton href="" size="small" edge="start" color="inherit" aria-label="menu" sx={{ mr: 1 }}>
          < LogoutIcon/>
        </IconButton>

      </Box>
    </React.Fragment>
  );
}
